import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const NavbarContainer = styled.nav`
  display: flex;
  justify-content: center;
  background-color: ${({ theme }) => theme.navbarBackground};
  padding: 10px 0;
`;

const NavItem = styled(Link)`
  margin: 0 20px; /* Espacio entre los elementos de la navbar */
  color: ${({ theme }) => theme.text};
  text-decoration: none;
  font-size: 18px;
  font-weight: bold;

  &:hover {
    color: ${({ theme }) => theme.primaryButton}; /* Cambiar color al pasar el mouse */
  }
`;

const Navbar = () => {
  return (
    <NavbarContainer>
      <NavItem to="/productos">Productos</NavItem>
      <NavItem to="/ordenes">Ordenes</NavItem>
      <NavItem to="/reportes">Generaci√≥n de Reportes</NavItem>
    </NavbarContainer>
  );
};

export default Navbar;
